W celu automatyzacji kompilacji przygotowałem następujący Makefile w który nie będę się zagłębiał. Natomiast zwrócę uwagę na pliki linker.ld oraz krótko do czego służy grub.cfg plik: src/linker.ld ENTRY(start) SECTIONS { . = 1M; .boot : { /* umieszczenie sekcji multiboot na początku programu z tego momentu zaczyna się działanie systemu */ *(.multiboot_header) } .text : { /* główna sekcja programu */ *(.text) }
} Plik linker.ld definiuje nam w jakie miejsca jest wstawiana która częśc programu. Na poczatku mamy . = 1M; jest to ignorowanie pierwszego MiB miejsca na nośniku, ponieważ znajdują się tam specjalne adresy. Następnie mamy sekcję .boot w której będzie informacja o standardzie multiboot a dopiero na końcu przechodzimy do właściwego kernela w sekcji .text. plik: src/grub.cfg set timeout=0
set default=0 menuentry "os" { multiboot2 /boot/kernel.bin boot
} Ten plik definiuje nam w jaki sposób ma być stworzony plik ISO naszego systemu. menuentry oznacza nazwę która będzie się pojawiać w tabeli grub2, następnie w klamerkach definiujemy ścieżkę do binarki kernela oraz w następnej linijce nazwę punktu wejścia.
